Type: Geometry
Level: Level 5
Problem: The area of the semicircle in Figure A is half the area of the circle in Figure B. The area of a square inscribed in the semicircle, as shown, is what fraction of the area of a square inscribed in the circle? Express your answer as a common fraction.

[asy]
defaultpen(linewidth(0.8));

size(5cm,5cm);

draw((0,0)..(1,1)..(2,0)--(0,0));

draw((0.5,0)--(0.5,0.87)--(1.5,0.87)--(1.5,0));

draw(Circle((4,0),1));

pair A,B,C,D;

A=(3.3,0.7);
B=(3.3,-0.7);
D=(4.7,0.7);
C=(4.7,-0.7);

draw(A--B--C--D--A);

label("Figure A",(1,1.3));
label("Figure B",(4,1.3));

[/asy]

Type: Prealgebra
Level: Level 5
Problem: Each triangle is a 30-60-90 triangle, and the hypotenuse of one triangle is the longer leg of an adjacent triangle. The hypotenuse of the larger triangle is 16 centimeters. What is the number of centimeters in the length of the longer leg of the smaller triangle?

[asy]size(150); pair O; for(int i = 2; i < 5; ++i){
draw(O--((2/sqrt(3))^i)*dir(30*i));
}
for(int g = 2; g < 4; ++g){
draw( ((2/sqrt(3))^g)*dir(30*g)-- ((2/sqrt(3))^(g+1))*dir(30*g+30));
}
label("16 cm", O--(16/9)*dir(120), W);
//label("$30^{\circ}$",.4*dir(0),dir(90));
//label("$30^{\circ}$",.4*dir(25),dir(115));
label("$30^{\circ}$",.4*dir(50),dir(140));
label("$30^{\circ}$",.4*dir(85),dir(175));
real t = (2/(sqrt(3)));
//draw(rightanglemark((1,.1),(1,0),(.9,0),s=3));
draw(rightanglemark(rotate(30)*(0,t**4),rotate(0)*(0,t**3),O,s=3));
draw(rightanglemark(rotate(0)*(0,t**3),rotate(-30)*(0,t**2),O,s=3));
//draw(rightanglemark(rotate(-30)*(0,t**2),rotate(-60)*(0,t**1),O,s=3));
[/asy]

Type: Geometry
Level: Level 5
Problem: A solid right prism $ABCDEF$ has a height of $16$ and equilateral triangles bases with side length $12,$ as shown. $ABCDEF$ is sliced with a straight cut through points $M,$ $N,$ $P,$ and $Q$ on edges $DE,$ $DF,$ $CB,$ and $CA,$ respectively. If $DM=4,$ $DN=2,$ and $CQ=8,$ determine the volume of the solid $QPCDMN.$ [asy]

pair A, B, C, D, E, F, M,N,P,Q;
A=(0,0);
B=(12,0);
C=(6,-6);
D=(6,-22);
E=(0,-16);
F=(12,-16);
M=(2D+E)/3;
N=(5D+F)/6;
P=(2C+B)/3;
Q=(2A+C)/3;

draw(A--B--C--A--E--D--F--B--C--D);
draw(M--N--P--Q--M, dashed);
label("$A$", A, NW);
label("$B$", B, NE);
label("$C$", C, dir(90));
label("$D$", D, S);
label("$E$", E, SW);
label("$F$", F, SE);
label("$M$", M, SW);
label("$N$", N, SE);
label("$P$", P, SE);
label("$Q$", Q, W);
label("12", (A+B)/2, dir(90));
label("16", (B+F)/2, dir(0));
[/asy]

